import React from 'react';
import { Link } from 'react-router-dom';

const NavBar = () => {

  return (
    <nav>
    <div className='logo'>
      <h1>TravelFootprint.</h1>
    </div>
    <div>
      <ul>
        <li>
          <Link to="/">Home</Link>
        </li>
        <li>
          <Link to="/trips">Your Trips</Link>
        </li>
        <li>
          <Link to="/about">About</Link>
        </li>
      </ul>
      </div>
    </nav>
  );
};

export default NavBar;
